import React, { useState } from "react";

// Static list of current semester courses
const courses = [
  { code: "COSC2758", name: "Full Stack Development" },
  { code: "COSC2531", name: "Programming Principles" },
  { code: "COSC2761", name: "Web Security" }
];

const TutorApplicationForm = () => {
  const [selectedCourses, setSelectedCourses] = useState<string[]>([]);
  const [roles, setRoles] = useState<string[]>([]);
  const [availability, setAvailability] = useState("");
  const [skills, setSkills] = useState("");
  const [credentials, setCredentials] = useState("");
  const [submitted, setSubmitted] = useState(false);

  const toggleSelection = (value: string, list: string[], setList: any) => {
    setList((prev: string[]) =>
      prev.includes(value) ? prev.filter((v) => v !== value) : [...prev, value]
    );
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (!availability || roles.length === 0 || selectedCourses.length === 0 || !skills || !credentials) {
      alert("Please complete all fields.");
      return;
    }

    const formData = {
      roles,
      selectedCourses,
      availability,
      skills,
      credentials,
    };

    localStorage.setItem("tutorApplication", JSON.stringify(formData));
    setSubmitted(true);
  };

  return (
    <div className="p-6 max-w-2xl mx-auto mt-6 border rounded shadow">
      <h2 className="text-2xl font-bold mb-4 text-center">Tutor Application Form</h2>
      {submitted ? (
        <p className="text-green-600 text-center">✅ Application submitted successfully!</p>
      ) : (
        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label className="block font-semibold mb-1">Select Role(s):</label>
            <label><input type="checkbox" onChange={() => toggleSelection("Tutor", roles, setRoles)} /> Tutor</label>
            <label className="ml-4"><input type="checkbox" onChange={() => toggleSelection("Lab Assistant", roles, setRoles)} /> Lab Assistant</label>
          </div>

          <div>
            <label className="block font-semibold mb-1">Select Courses:</label>
            {courses.map(course => (
              <label key={course.code} className="block">
                <input
                  type="checkbox"
                  onChange={() => toggleSelection(course.code, selectedCourses, setSelectedCourses)}
                /> {course.code} - {course.name}
              </label>
            ))}
          </div>

          <div>
            <label className="block font-semibold mb-1">Availability:</label>
            <select className="border p-2 w-full rounded" value={availability} onChange={(e) => setAvailability(e.target.value)}>
              <option value="">-- Select --</option>
              <option value="Full-time">Full-time</option>
              <option value="Part-time">Part-time</option>
            </select>
          </div>

          <div>
            <label className="block font-semibold mb-1">Skills:</label>
            <textarea className="w-full border p-2 rounded" value={skills} onChange={(e) => setSkills(e.target.value)} />
          </div>

          <div>
            <label className="block font-semibold mb-1">Academic Credentials:</label>
            <textarea className="w-full border p-2 rounded" value={credentials} onChange={(e) => setCredentials(e.target.value)} />
          </div>

          <button type="submit" className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded w-full">
            Submit Application
          </button>
        </form>
      )}
    </div>
  );
};

export default TutorApplicationForm;
